import React from "react";

const Contact = () => {
  return (
    <section id="contact" className="py-20 px-6 bg-gray-50 text-center">
      <div className="max-w-xl mx-auto">
        <h2 className="text-3xl font-bold mb-4">Let's Connect</h2>
        <p className="text-gray-600 mb-6">
          Want to work together or have a question? Feel free to drop me a message.
        </p>
        <a
          href="mailto:your.email@example.com"
          className="inline-block bg-black text-white px-6 py-3 rounded-full hover:bg-gray-800"
        >
          Say Hello
        </a>
      </div>
    </section>
  );
};

export default Contact;
